                'content' => '君子之為惪（德）也，[18]□□□□□終也。[19]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:14',
                'updated_at' => '2016-12-08 10:12:14',
            ),
            174 => 
            array (
                'id' => 175,
                'order' => '20',
                'article_id' => 8,
                'content' => '善，人[19]道也；惪（德），而〈天〉□□。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:14',
                'updated_at' => '2016-12-08 10:12:14',
            ),
            175 => 
            array (
                'id' => 176,
                'order' => '21',
                'article_id' => 8,
                'content' => '不聖不[20]智，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:14',
                'updated_at' => '2016-12-08 10:12:14',
            ),
            176 => 
            array (
                'id' => 177,
                'order' => '22',
                'article_id' => 8,
                'content' => '不果[21]不柬（簡），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            177 => 
            array (
                'id' => 178,
                'order' => '23',
                'article_id' => 8,
                'content' => '未尚（嘗）[22]（聞）君子道，胃（謂）之不聰。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            178 => 
            array (
                'id' => 179,
                'order' => '24',
                'article_id' => 8,
                'content' => '（聞）君子道而不智（知）[23]其君子道也，胃（謂）之不聖。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            179 => 
            array (
                'id' => 180,
                'order' => '25',
                'article_id' => 8,
                'content' => '見而智（知）之，智也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            180 => 
            array (
                'id' => 181,
                'order' => '26',
                'article_id' => 8,
                'content' => '「明明才（在）下，（虩）（虩）[25]才（在）上」，此之胃（謂）也。■',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            181 => 
            array (
                'id' => 182,
                'order' => '27',
                'article_id' => 8,
                'content' => '聖人智（知）而〈天〉[26]道也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            182 => 
            array (
                'id' => 183,
                'order' => '28',
                'article_id' => 8,
                'content' => '見而智（知）之，[27]智也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            183 => 
            array (
                'id' => 184,
                'order' => '29',
                'article_id' => 8,
                'content' => '五[28]□□□□也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            184 => 
            array (
                'id' => 185,
                'order' => '30',
                'article_id' => 8,
                'content' => '「文[29]□□□□□于而〈天〉」，此之胃（謂）也。■',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            185 => 
            array (
                'id' => 186,
                'order' => '31',
                'article_id' => 8,
                'content' => '安[30]而行之，義也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            186 => 
            array (
                'id' => 187,
                'order' => '32',
                'article_id' => 8,
                'content' => '和[31]則同，同則善。■',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            187 => 
            array (
                'id' => 188,
                'order' => '33',
                'article_id' => 8,
                'content' => '（中）心兌（悅）[32]於兄弟，（戚）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            188 => 
            array (
                'id' => 189,
                'order' => '34',
                'article_id' => 8,
                'content' => '（中）心[33]（辯）肰（然）而正行之，植（直）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            189 => 
            array (
                'id' => 190,
                'order' => '35',
                'article_id' => 8,
                'content' => '不[34]以少（小）道夌大道，柬（簡）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            190 => 
            array (
                'id' => 191,
                'order' => '36',
                'article_id' => 8,
                'content' => '以其外心與人交，遠也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:15',
                'updated_at' => '2016-12-08 10:12:15',
            ),
            191 => 
            array (
                'id' => 192,
                'order' => '37',
                'article_id' => 8,
                'content' => '嚴而畏[36]之，（尊）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            192 => 
            array (
                'id' => 193,
                'order' => '38',
                'article_id' => 8,
                'content' => '不匿，不[37]於道。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            193 => 
            array (
                'id' => 194,
                'order' => '39',
                'article_id' => 8,
                'content' => '又（有）大辠（罪）而弗大[38]（誅）也，不【行】也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            194 => 
            array (
                'id' => 195,
                'order' => '40',
                'article_id' => 8,
                'content' => '東〈柬（簡）〉之為言猷（猶）練[39]也，大而晏者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            195 => 
            array (
                'id' => 196,
                'order' => '41',
                'article_id' => 8,
                'content' => '匿，[40]（仁）之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            196 => 
            array (
                'id' => 197,
                'order' => '42',
                'article_id' => 8,
                'content' => '「不不梂，不勥（剛）不矛（柔）」，此之胃（謂）[41]也。■',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            197 => 
            array (
                'id' => 198,
                'order' => '43',
                'article_id' => 8,
                'content' => '大而[42]晏者，能又（有）取安（焉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            198 => 
            array (
                'id' => 199,
                'order' => '44',
                'article_id' => 8,
                'content' => '君[43]子智（知）而與（舉）之，胃（謂）之（尊）臤（賢）；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            199 => 
            array (
                'id' => 200,
                'order' => '45',
                'article_id' => 8,
                'content' => '耳目鼻口手足六者，心之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            200 => 
            array (
                'id' => 201,
                'order' => '46',
                'article_id' => 8,
                'content' => '進，莫敢不進；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:16',
            ),
            201 => 
            array (
                'id' => 202,
                'order' => '47',
                'article_id' => 8,
                'content' => '目而智（知）之胃（謂）之進之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:16',
                'updated_at' => '2016-12-08 10:12:17',
            ),
            202 => 
            array (
                'id' => 203,
                'order' => '48',
                'article_id' => 8,
                'content' => '幾而智（知）之，天也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:17',
                'updated_at' => '2016-12-08 10:12:17',
            ),
            203 => 
            array (
                'id' => 204,
                'order' => '49',
                'article_id' => 8,
                'content' => '其[48]人（施）者（諸）人，也。■',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:17',
                'updated_at' => '2016-12-08 10:12:17',
            ),
            204 => 
            array (
                'id' => 205,
                'order' => '50',
                'article_id' => 8,
                'content' => '（聞）道而畏者，好[49]義者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:17',
                'updated_at' => '2016-12-08 10:12:17',
            ),
            205 => 
            array (
                'id' => 206,
                'order' => '1',
                'article_id' => 9,
                'content' => '湯（唐）吳（虞）之道，而不（傳）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:17',
                'updated_at' => '2016-12-08 10:12:17',
            ),
            206 => 
            array (
                'id' => 207,
                'order' => '2',
                'article_id' => 9,
                'content' => '而不（傳），聖之[1]盛也。',
