                'created_at' => '2016-12-08 10:12:17',
                'updated_at' => '2016-12-08 10:12:17',
            ),
            212 => 
            array (
                'id' => 213,
                'order' => '8',
                'article_id' => 9,
                'content' => '，義之至也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:17',
                'updated_at' => '2016-12-08 10:12:17',
            ),
            213 => 
            array (
                'id' => 214,
                'order' => '9',
                'article_id' => 9,
                'content' => '尊臤（賢）[8]遺（親），我（義）而未（仁）也。',
