                'created_at' => '2016-12-08 10:12:17',
                'updated_at' => '2016-12-08 10:12:17',
            ),
            214 => 
            array (
                'id' => 215,
                'order' => '10',
                'article_id' => 9,
                'content' => '（愛）（親）尊臤（賢），吳（虞）舜其人也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:18',
                'updated_at' => '2016-12-08 10:12:18',
            ),
            215 => 
            array (
                'id' => 216,
                'order' => '11',
                'article_id' => 9,
                'content' => '（節？）虖（乎）脂膚血（氣）之青（情），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:18',
                'updated_at' => '2016-12-08 10:12:18',
            ),
            216 => 
            array (
                'id' => 217,
                'order' => '12',
                'article_id' => 9,
                'content' => '□豊（禮）愄（畏）守樂孫民（教）也。',
