                'created_at' => '2016-12-08 10:12:18',
                'updated_at' => '2016-12-08 10:12:18',
            ),
            223 => 
            array (
                'id' => 224,
                'order' => '19',
                'article_id' => 9,
                'content' => '方才（在）下立（位），不以仄夫為[18]巠（輕）；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:18',
                'updated_at' => '2016-12-08 10:12:18',
            ),
            224 => 
            array (
                'id' => 225,
                'order' => '20',
                'article_id' => 9,
                'content' => '亟（極）（仁）[19]之至，利天下而弗利也。',
