                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            231 => 
            array (
                'id' => 232,
                'order' => '27',
                'article_id' => 9,
                'content' => '天下而[26]受（授）臤（賢），退而（養）其生。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            232 => 
            array (
                'id' => 233,
                'order' => '28',
                'article_id' => 9,
                'content' => '聖[27]者不才（在）上，天下壞，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            233 => 
            array (
                'id' => 234,
                'order' => '29',
                'article_id' => 9,
                'content' => '女（如）此也。[29]',
