                'updated_at' => '2016-12-08 10:12:19',
            ),
            234 => 
            array (
                'id' => 235,
                'order' => '1',
                'article_id' => 10,
                'content' => '不不，忠之至也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            235 => 
            array (
                'id' => 236,
                'order' => '2',
                'article_id' => 10,
                'content' => '忠[1]信（積）而民弗（親）信者，未之又（有）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            236 => 
            array (
                'id' => 237,
                'order' => '3',
                'article_id' => 10,
                'content' => '忠人亡[2]，信人不伓（背）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            237 => 
            array (
                'id' => 238,
                'order' => '4',
                'article_id' => 10,
                'content' => '匋而者尚，信[3]之至也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            238 => 
            array (
                'id' => 239,
                'order' => '5',
                'article_id' => 10,
                'content' => '不（期）[4]而可者，天也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            239 => 
            array (
                'id' => 240,
                'order' => '6',
                'article_id' => 10,
                'content' => '心□□□[5]（親），君子弗申尔。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            240 => 
            array (
                'id' => 241,
                'order' => '7',
                'article_id' => 10,
                'content' => '忠之為[6]（道）也，百工不古，而人（養）（皆）足。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:19',
            ),
            241 => 
            array (
                'id' => 242,
                'order' => '8',
                'article_id' => 10,
                'content' => '君子其它（施）也[7]忠，古（故）（）（親）尃（傅）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:19',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            242 => 
            array (
                'id' => 243,
                'order' => '9',
                'article_id' => 10,
                'content' => '氏（是）古（故）古之所[8]以行虖（乎）嘍者，女（如）此也。[9]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:20',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            243 => 
            array (
                'id' => 244,
                'order' => '1',
                'article_id' => 11,
                'content' => '成之（聞）之曰：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:20',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            244 => 
            array (
                'id' => 245,
                'order' => '2',
                'article_id' => 11,
                'content' => '行不信則命不從，[1]信不（著）則言不樂。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:20',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            245 => 
            array (
                'id' => 246,
                'order' => '3',
                'article_id' => 11,
                'content' => '民不從上之命，不信其言，而能（含）惪（德）者，未之[2]又（有）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:20',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            246 => 
            array (
                'id' => 247,
                'order' => '4',
                'article_id' => 11,
                'content' => '君子之於（教）也，其道民也不，則其也弗深（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:20',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            247 => 
            array (
                'id' => 248,
                'order' => '5',
                'article_id' => 11,
                'content' => '是古（故）亡（乎）其身而[4]（乎）其（詞），唯（雖）（厚）其命，民弗從之（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:20',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            248 => 
            array (
                'id' => 249,
                'order' => '6',
                'article_id' => 11,
                'content' => '是古（故）畏備（服）型（刑）罰之婁（屢）行也，[5]（由）（上）之弗身也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:20',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            249 => 
            array (
                'id' => 250,
                'order' => '7',
                'article_id' => 11,
                'content' => '（上）句（苟）身備（服）之，則民必有甚安（焉）者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:20',
                'updated_at' => '2016-12-08 10:12:20',
            ),
            250 => 
            array (
                'id' => 251,
                'order' => '8',
                'article_id' => 11,
                'content' => '君均而立於（祚），一宮之人不（勝）[7]其敬。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            251 => 
            array (
                'id' => 252,
                'order' => '9',
                'article_id' => 11,
                'content' => '一軍之人不（勝）其（勇）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            252 => 
            array (
                'id' => 253,
                'order' => '10',
                'article_id' => 11,
                'content' => '唯（雖）肰（然），其也不（厚），[9]其重也弗多（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            253 => 
            array (
                'id' => 254,
                'order' => '11',
                'article_id' => 11,
                'content' => '不求者（諸）其（本）而（攻）者（諸）其[10]末，弗得（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            254 => 
            array (
                'id' => 255,
                'order' => '12',
                'article_id' => 11,
                'content' => '句（苟）不從其（由），不反其（本），未有可得也者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            255 => 
            array (
                'id' => 256,
                'order' => '13',
                'article_id' => 11,
                'content' => '戎夫不強，加糧弗足（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            256 => 
            array (
                'id' => 257,
                'order' => '14',
                'article_id' => 11,
                'content' => '是古（故）君子[13]之於言也，非從末流者之貴，窮湶（源）反（本）者之貴。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            257 => 
            array (
                'id' => 258,
                'order' => '15',
                'article_id' => 11,
                'content' => '句（苟）不從其（由），[14]不反其（本），唯（雖）強之弗內（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            258 => 
            array (
                'id' => 259,
                'order' => '16',
                'article_id' => 11,
                'content' => '是以民可[15]敬道（導）也，而不可（弇）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            259 => 
            array (
                'id' => 260,
                'order' => '17',
                'article_id' => 11,
                'content' => '古（故）君子不貴（庶）勿（物）而貴與[16]民又（有）同也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            260 => 
            array (
                'id' => 261,
                'order' => '18',
                'article_id' => 11,
                'content' => '福而貧賤，則民谷（欲）其[17]福之大也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            261 => 
            array (
                'id' => 262,
                'order' => '19',
                'article_id' => 11,
                'content' => '反此道也，民必因此厚也[18]以復之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            262 => 
            array (
                'id' => 263,
                'order' => '20',
                'article_id' => 11,
                'content' => '反者（諸）（己）而可以[19]智（知）人。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            263 => 
            array (
                'id' => 264,
                'order' => '21',
                'article_id' => 11,
                'content' => '是以智（知）而求之不疾，其迲（去）人弗遠（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:21',
                'updated_at' => '2016-12-08 10:12:21',
            ),
            264 => 
            array (
                'id' => 265,
                'order' => '22',
                'article_id' => 11,
                'content' => '是古（故）凡勿（物）才（在）疾之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            265 => 
            array (
                'id' => 266,
                'order' => '23',
                'article_id' => 11,
                'content' => '君子曰：疾之，[22]行之不疾，未又（有）能深之者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            266 => 
            array (
                'id' => 267,
                'order' => '24',
                'article_id' => 11,
                'content' => '民弗從。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            267 => 
            array (
                'id' => 268,
                'order' => '25',
                'article_id' => 11,
                'content' => '是以上之亙（恆）[24]才信於眾。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            268 => 
            array (
                'id' => 269,
                'order' => '26',
                'article_id' => 11,
                'content' => '此言也，言信於眾之可以[25]淒惪（德）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            269 => 
            array (
                'id' => 270,
                'order' => '27',
                'article_id' => 11,
                'content' => '聖人之眚（性）與中人之眚（性），其生而未又（有）非之節於而也，[26]則猷（猶）是也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            270 => 
            array (
                'id' => 271,
                'order' => '28',
                'article_id' => 11,
                'content' => '及其尃長而（厚）[27]大也，則聖人不可由與之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            271 => 
            array (
                'id' => 272,
                'order' => '29',
                'article_id' => 11,
                'content' => '《君奭》曰「（襄）我二人，毋又（有）合才音」害（曷）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            272 => 
            array (
                'id' => 273,
                'order' => '30',
                'article_id' => 11,
                'content' => '君子曰：唯又（有）其亙（恆）而[29]可能終之為難。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            273 => 
            array (
                'id' => 274,
                'order' => '31',
                'article_id' => 11,
                'content' => '天大（常），以里（理）人侖（倫）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            274 => 
            array (
                'id' => 275,
                'order' => '32',
                'article_id' => 11,
                'content' => '折（制）為君臣之義，（著）為父子之新（親），分[31]為夫婦之（辨）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:22',
            ),
            275 => 
            array (
                'id' => 276,
                'order' => '33',
                'article_id' => 11,
                'content' => '是古（故）小人（亂）天（常）以逆大道，君子（治）人侖（倫）以川（順）[32]天惪（德）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:22',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            276 => 
            array (
                'id' => 277,
                'order' => '34',
                'article_id' => 11,
                'content' => '君子（席）之上（讓）而；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            277 => 
            array (
                'id' => 278,
                'order' => '35',
                'article_id' => 11,
                'content' => '少（小）人[34]不人於刃，君子不人於豊（禮）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            278 => 
            array (
                'id' => 279,
                'order' => '36',
                'article_id' => 11,
                'content' => '言[35]語之，其（勝）也不若其已也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            279 => 
            array (
                'id' => 280,
                'order' => '37',
                'article_id' => 11,
                'content' => '唯君子道可近求而可遠（？）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            280 => 
            array (
                'id' => 281,
                'order' => '38',
                'article_id' => 11,
                'content' => '言（慎）求之於（己），而可以至川（順）天（常）（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            281 => 
            array (
                'id' => 282,
                'order' => '39',
                'article_id' => 11,
                'content' => '《康（誥）》曰「不還大暊，文王（作）罰，[38]型（刑）（茲）亡」害（曷）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            282 => 
            array (
                'id' => 283,
                'order' => '40',
                'article_id' => 11,
                'content' => '是[39]古（故）君子（慎）六立以巳（祀）天（常）。[40]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            283 => 
            array (
                'id' => 284,
                'order' => '1',
                'article_id' => 12,
                'content' => '惪（德）義，明（乎）民侖（倫），可以為君。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            284 => 
            array (
                'id' => 285,
                'order' => '2',
                'article_id' => 12,
                'content' => '賞與坓（刑），（禍）福之也，或前之者矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            285 => 
            array (
                'id' => 286,
                'order' => '3',
                'article_id' => 12,
                'content' => '正欽，所以[2]（攻）□□。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            286 => 
            array (
                'id' => 287,
                'order' => '4',
                'article_id' => 12,
                'content' => '（仁）為可新（親）[3]也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:23',
                'updated_at' => '2016-12-08 10:12:23',
            ),
            287 => 
            array (
                'id' => 288,
                'order' => '5',
                'article_id' => 12,
                'content' => '學非改侖（倫）也，學（己）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            288 => 
            array (
                'id' => 289,
                'order' => '6',
                'article_id' => 12,
                'content' => '桀不易[5]（禹）民而句（後）亂之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            289 => 
            array (
                'id' => 290,
                'order' => '7',
                'article_id' => 12,
                'content' => '（禹）[6]之行水，水之道也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            290 => 
            array (
                'id' => 291,
                'order' => '8',
                'article_id' => 12,
                'content' => '莫[7]不又（有）道安（焉），人道為近。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            291 => 
            array (
                'id' => 292,
                'order' => '9',
                'article_id' => 12,
                'content' => '者出所以智（知）[8]（己），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            292 => 
            array (
                'id' => 293,
                'order' => '10',
                'article_id' => 12,
                'content' => '（由）豊（禮）智（知）[9]樂，（由）樂智（知）（哀）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            293 => 
            array (
                'id' => 294,
                'order' => '11',
                'article_id' => 12,
                'content' => '又（有）[10]智（知）豊（禮）而不智（知）樂者，亡智（知）樂而不智（知）豊（禮）者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            294 => 
            array (
                'id' => 295,
                'order' => '12',
                'article_id' => 12,
                'content' => '善者民必眾，眾未必（治），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            295 => 
            array (
                'id' => 296,
                'order' => '13',
                'article_id' => 12,
                'content' => '是以為正（政）者（教）道[12]之取先。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            296 => 
            array (
                'id' => 297,
                'order' => '14',
                'article_id' => 12,
                'content' => '（教）[13]以（辯）兌（說），則民埶貴以忘。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:24',
                'updated_at' => '2016-12-08 10:12:24',
            ),
            297 => 
            array (
                'id' => 298,
                'order' => '15',
                'article_id' => 12,
                'content' => '（教）以[14]則民少以（吝）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            298 => 
            array (
                'id' => 299,
                'order' => '16',
                'article_id' => 12,
                'content' => '（教）以懽（權）（謀），則民湯（？）遠豊（禮）亡新（親）（仁）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            299 => 
            array (
                'id' => 300,
                'order' => '17',
                'article_id' => 12,
                'content' => '行此也，然句（後）可逾（？）也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            300 => 
            array (
                'id' => 301,
                'order' => '18',
                'article_id' => 12,
                'content' => '不（黨）則亡[17]（怨），思則□□。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            301 => 
            array (
                'id' => 302,
                'order' => '19',
                'article_id' => 12,
                'content' => '（教）其正（政），[18]不（教）其人，正（政）弗行矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            302 => 
            array (
                'id' => 303,
                'order' => '20',
                'article_id' => 12,
                'content' => '可（教）也而不可迪其民，而民不可（止）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            303 => 
            array (
                'id' => 304,
                'order' => '21',
                'article_id' => 12,
                'content' => '行矣而亡，羕心於子俍，忠信日益而不自智（知）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            304 => 
            array (
                'id' => 305,
                'order' => '22',
                'article_id' => 12,
                'content' => '民可（使）道[21]之，而不可（使）智（知）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            305 => 
            array (
                'id' => 306,
                'order' => '23',
                'article_id' => 12,
                'content' => '桀不胃（謂）其民必亂，而民又（有）[22]為亂矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            306 => 
            array (
                'id' => 307,
                'order' => '24',
                'article_id' => 12,
                'content' => '（勞）之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            307 => 
            array (
                'id' => 308,
                'order' => '25',
                'article_id' => 12,
                'content' => '非豊（禮）而民兌（悅）[24]此少（小）人矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            308 => 
            array (
                'id' => 309,
                'order' => '26',
                'article_id' => 12,
                'content' => '不以旨谷（欲）其義。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            309 => 
            array (
                'id' => 310,
                'order' => '27',
                'article_id' => 12,
                'content' => '民五之方各，[26]十之方靜，百之而句（後）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            310 => 
            array (
                'id' => 311,
                'order' => '28',
                'article_id' => 12,
                'content' => '為古（故）（率）民向方者，唯惪（德）可。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            311 => 
            array (
                'id' => 312,
                'order' => '29',
                'article_id' => 12,
                'content' => '惪（德）之流，速（乎）而（傳）[28]命。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            312 => 
            array (
                'id' => 313,
                'order' => '30',
                'article_id' => 12,
                'content' => '古（故）為正（政）者，或侖（論）之，或羕之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:25',
                'updated_at' => '2016-12-08 10:12:25',
            ),
            313 => 
            array (
                'id' => 314,
                'order' => '31',
                'article_id' => 12,
                'content' => '安（焉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            314 => 
            array (
                'id' => 315,
                'order' => '32',
                'article_id' => 12,
                'content' => '坓（刑）不隶於君子，豊（禮）不[31]隶於小人。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            315 => 
            array (
                'id' => 316,
                'order' => '33',
                'article_id' => 12,
                'content' => '不[32]（愛）則不新（親），不□則弗，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            316 => 
            array (
                'id' => 317,
                'order' => '34',
                'article_id' => 12,
                'content' => '弗恿則[33]亡復。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            317 => 
            array (
                'id' => 318,
                'order' => '35',
                'article_id' => 12,
                'content' => '（？）[34]不足以安民，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            318 => 
            array (
                'id' => 319,
                'order' => '36',
                'article_id' => 12,
                'content' => '殺[35]不足以（）民。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            319 => 
            array (
                'id' => 320,
                'order' => '37',
                'article_id' => 12,
                'content' => '上好是勿（物）也，[36]下必又（有）甚安（焉）者。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            320 => 
            array (
                'id' => 321,
                'order' => '38',
                'article_id' => 12,
                'content' => '又（有）是（施）少（小）[37]又（有）利，而大又（有）（害）者，又（有）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            321 => 
            array (
                'id' => 322,
                'order' => '39',
                'article_id' => 12,
                'content' => '凡（動）民必訓（順）民心，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            322 => 
            array (
                'id' => 323,
                'order' => '1',
                'article_id' => 13,
                'content' => '凡人唯（雖）又（有）眚（性），心亡奠志，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            323 => 
            array (
                'id' => 324,
                'order' => '2',
                'article_id' => 13,
                'content' => '（待）勿（物）而句（後）（作），（待）兌（悅）而句（後）行，（待）習而句（後）[1]奠。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:26',
            ),
            324 => 
            array (
                'id' => 325,
                'order' => '3',
                'article_id' => 13,
                'content' => '眚（性）自命出，命[2]自天降。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:26',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            325 => 
            array (
                'id' => 326,
                'order' => '4',
                'article_id' => 13,
                'content' => '智□□□[3]出之，智（知）宜（義）者能內（納）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            326 => 
            array (
                'id' => 327,
                'order' => '5',
                'article_id' => 13,
                'content' => '善不□□□，[4]所善所不善，埶（勢）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            327 => 
            array (
                'id' => 328,
                'order' => '6',
                'article_id' => 13,
                'content' => '□□□唯（雖）又（有）眚（性）心弗取不出。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            328 => 
            array (
                'id' => 329,
                'order' => '7',
                'article_id' => 13,
                'content' => '亡与不□□□□□[6]蜀（獨）行，猷（猶）口之不可蜀（獨）言也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            329 => 
            array (
                'id' => 330,
                'order' => '8',
                'article_id' => 13,
                'content' => '而學或（使）之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            330 => 
            array (
                'id' => 331,
                'order' => '9',
                'article_id' => 13,
                'content' => '柔之[8]約，柔取之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            331 => 
            array (
                'id' => 332,
                'order' => '10',
                'article_id' => 13,
                'content' => '凡眚（性）[9]或（動）之，或（逢？）之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            332 => 
            array (
                'id' => 333,
                'order' => '11',
                'article_id' => 13,
                'content' => '凡（動）眚（性）[10]者，勿（物）也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            333 => 
            array (
                'id' => 334,
                'order' => '12',
                'article_id' => 13,
                'content' => '羕（養）眚（性）[11]者，習也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            334 => 
            array (
                'id' => 335,
                'order' => '13',
                'article_id' => 13,
                'content' => '勿（物）[12]之埶（勢）者之胃（謂）埶（勢），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            335 => 
            array (
                'id' => 336,
                'order' => '14',
                'article_id' => 13,
                'content' => '習也[13]者，又（有）以習其眚（性）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            336 => 
            array (
                'id' => 337,
                'order' => '15',
                'article_id' => 13,
                'content' => '（道）四述（術），唯[14]人（道）為可（道）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:27',
            ),
            337 => 
            array (
                'id' => 338,
                'order' => '16',
                'article_id' => 13,
                'content' => '時（詩）、箸（書）、豊（禮）、樂，其司（始）出皆生[15]於人。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:27',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            338 => 
            array (
                'id' => 339,
                'order' => '17',
                'article_id' => 13,
                'content' => '聖人比其[16]頪（類）而侖（論）會之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            339 => 
            array (
                'id' => 340,
                'order' => '18',
                'article_id' => 13,
                'content' => '里（理）[17]其青（情）而出內（入）之，肰（然）句（後）復以（教）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            340 => 
            array (
                'id' => 341,
                'order' => '19',
                'article_id' => 13,
                'content' => '豊（禮）（作）於青（情），[18]或之也，堂（當）事因方而折（制）之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            341 => 
            array (
                'id' => 342,
                'order' => '20',
                'article_id' => 13,
                'content' => '或舍為[19]之即則也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            342 => 
            array (
                'id' => 343,
                'order' => '21',
                'article_id' => 13,
                'content' => '善其即，好其頌，樂其（道），兌（悅）其（教），是以敬安（焉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            343 => 
            array (
                'id' => 344,
                'order' => '22',
                'article_id' => 13,
                'content' => '拜，所以□□□[21]其也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            344 => 
            array (
                'id' => 345,
                'order' => '23',
                'article_id' => 13,
                'content' => '樂，（禮）之深澤也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            345 => 
            array (
                'id' => 346,
                'order' => '24',
                'article_id' => 13,
                'content' => '（聞）（笑）聖（聲），則羴（鮮）女（如）也斯（喜）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            346 => 
            array (
                'id' => 347,
                'order' => '25',
                'article_id' => 13,
                'content' => '聖（聽）（琴）（瑟）之聖（聲），[24]則女（如）也斯戁（難）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            347 => 
            array (
                'id' => 348,
                'order' => '26',
                'article_id' => 13,
                'content' => '（觀）卲（韶）（夏），則免（勉）女（如）也[25]斯僉（儉）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            348 => 
            array (
                'id' => 349,
                'order' => '27',
                'article_id' => 13,
                'content' => '其居即（次）也舊，其反善復（始）也[26]（慎），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            349 => 
            array (
                'id' => 350,
                'order' => '28',
                'article_id' => 13,
                'content' => '凡古樂龍心，益樂龍指，皆（教）其人者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:28',
                'updated_at' => '2016-12-08 10:12:28',
            ),
            350 => 
            array (
                'id' => 351,
                'order' => '29',
                'article_id' => 13,
                'content' => '凡至樂必悲，哭亦悲，皆至其情也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            351 => 
            array (
                'id' => 352,
                'order' => '30',
                'article_id' => 13,
                'content' => '（哀）、樂，其眚（性）相近也，是古（故）其心[29]不遠。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            352 => 
            array (
                'id' => 353,
                'order' => '31',
                'article_id' => 13,
                'content' => '樂之（動）心也，[30]（？）深舀，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            353 => 
            array (
                'id' => 354,
                'order' => '32',
                'article_id' => 13,
                'content' => '凡（憂）思而句（後）悲，[31]凡樂思而句（後）忻。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            354 => 
            array (
                'id' => 355,
                'order' => '33',
                'article_id' => 13,
                'content' => '其心則其聖（聲）亦肰（然）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            355 => 
            array (
                'id' => 356,
                'order' => '34',
                'article_id' => 13,
                'content' => '（喜）斯慆，慆斯奮，奮斯羕（咏），羕（咏）斯猷，猷斯。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            356 => 
            array (
                'id' => 357,
                'order' => '35',
                'article_id' => 13,
                'content' => '（慍）斯（憂），（憂）斯，[34]斯戁，戁斯，斯通。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            357 => 
            array (
                'id' => 358,
                'order' => '36',
                'article_id' => 13,
                'content' => '凡學者隶〈求〉其心為難，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            358 => 
            array (
                'id' => 359,
                'order' => '37',
                'article_id' => 13,
                'content' => '唯（雖）能其事，不能其心，不貴。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            359 => 
            array (
                'id' => 360,
                'order' => '38',
                'article_id' => 13,
                'content' => '人之不能以為也，[37]可智（知）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            360 => 
            array (
                'id' => 361,
                'order' => '39',
                'article_id' => 13,
                'content' => '宜（義），敬之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            361 => 
            array (
                'id' => 362,
                'order' => '40',
                'article_id' => 13,
                'content' => '忠，信[39]之方也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            362 => 
            array (
                'id' => 363,
                'order' => '41',
                'article_id' => 13,
                'content' => '智頪（類）五，唯[40]宜（義）（道）為忻（近）忠。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            363 => 
            array (
                'id' => 364,
                'order' => '42',
                'article_id' => 13,
                'content' => '所為（道）者四，唯人（道）為[41]可（道）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            364 => 
            array (
                'id' => 365,
                'order' => '43',
                'article_id' => 13,
                'content' => '甬（用）青（情）之[42]至者，（哀）樂為甚。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:29',
                'updated_at' => '2016-12-08 10:12:29',
            ),
            365 => 
            array (
                'id' => 366,
                'order' => '44',
                'article_id' => 13,
                'content' => '目之好[43]色，耳之樂聖（聲），舀之（氣）也，人不難為之死。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            366 => 
            array (
                'id' => 367,
                'order' => '45',
                'article_id' => 13,
                'content' => '又（有）其為人之女（如）也，[44]不又（有）夫柬柬之心則采。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            367 => 
            array (
                'id' => 368,
                'order' => '46',
                'article_id' => 13,
                'content' => '人之攷（巧）[45]言利（詞）者，不又（有）夫詘詘之心則流。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            368 => 
            array (
                'id' => 369,
                'order' => '47',
                'article_id' => 13,
                'content' => '人之肰（然）可與和安者，不又（有）夫（奮）[46]之青（情）則。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            369 => 
            array (
                'id' => 370,
                'order' => '48',
                'article_id' => 13,
                'content' => '又（有）其為人之葲女（如）也，[48]弗不足。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            370 => 
            array (
                'id' => 371,
                'order' => '49',
                'article_id' => 13,
                'content' => '斯壴（矣），斯慮壴（矣），慮斯莫與之[48]結壴（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            371 => 
            array (
                'id' => 372,
                'order' => '50',
                'article_id' => 13,
                'content' => '凡人青（情）為可兌（悅）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            372 => 
            array (
                'id' => 373,
                'order' => '51',
                'article_id' => 13,
                'content' => '句（苟）又（有）其青（情），唯（雖）未之為，斯人信之壴（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            373 => 
            array (
                'id' => 374,
                'order' => '52',
                'article_id' => 13,
                'content' => '未（教）[51]而民亙（恆），眚（性）善者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            374 => 
            array (
                'id' => 375,
                'order' => '53',
                'article_id' => 13,
                'content' => '未型（刑）而民愄（畏），又（有）[52]心愄（畏）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            375 => 
            array (
                'id' => 376,
                'order' => '54',
                'article_id' => 13,
                'content' => '蜀（獨）処而樂，又（有）內者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            376 => 
            array (
                'id' => 377,
                'order' => '55',
                'article_id' => 13,
                'content' => '非之[54]而不可亞（惡）者，（篤）於（仁）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:30',
                'updated_at' => '2016-12-08 10:12:30',
            ),
            377 => 
            array (
                'id' => 378,
                'order' => '56',
                'article_id' => 13,
                'content' => '昏（聞）（道）反下，下交者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            378 => 
            array (
                'id' => 379,
                'order' => '57',
                'article_id' => 13,
                'content' => '上交近事君，下交得[56]眾近從正（政），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            379 => 
            array (
                'id' => 380,
                'order' => '58',
                'article_id' => 13,
                'content' => '同兌（悅）而交，以惪（德）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            380 => 
            array (
                'id' => 381,
                'order' => '59',
                'article_id' => 13,
                'content' => '門內之，谷（欲）其[58]也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            381 => 
            array (
                'id' => 382,
                'order' => '60',
                'article_id' => 13,
                'content' => '言及則[59]明（舉）之而毋。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            382 => 
            array (
                'id' => 383,
                'order' => '61',
                'article_id' => 13,
                'content' => '蜀（獨）[60]処則習父兄之所樂。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            383 => 
            array (
                'id' => 384,
                'order' => '62',
                'article_id' => 13,
                'content' => '凡（憂）患之事谷（欲）（任），樂事谷（欲）後。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            384 => 
            array (
                'id' => 385,
                'order' => '63',
                'article_id' => 13,
                'content' => '行谷（欲）恿（勇）而必至，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            385 => 
            array (
                'id' => 386,
                'order' => '64',
                'article_id' => 13,
                'content' => '樂谷（欲）睪而又有志，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            386 => 
            array (
                'id' => 387,
                'order' => '65',
                'article_id' => 13,
                'content' => '退谷（欲）而毋巠（輕），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            387 => 
            array (
                'id' => 388,
                'order' => '66',
                'article_id' => 13,
                'content' => '出言必又（有）[65]夫柬柬之信，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            388 => 
            array (
                'id' => 389,
                'order' => '67',
                'article_id' => 13,
                'content' => '居喪必又（有）夫（戀）（戀）之（哀）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            389 => 
            array (
                'id' => 390,
                'order' => '1',
                'article_id' => 14,
                'content' => '此。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            390 => 
            array (
                'id' => 391,
                'order' => '2',
                'article_id' => 14,
                'content' => '（仁）與宜（義）（戚）壴（矣），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            391 => 
            array (
                'id' => 392,
                'order' => '3',
                'article_id' => 14,
                'content' => '（教）此民尔（？）（使）[2]之又（有）向也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:31',
            ),
            392 => 
            array (
                'id' => 393,
                'order' => '4',
                'article_id' => 14,
                'content' => '新（親）父子，和大臣，（歸）四（鄰）[3]之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:31',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            393 => 
            array (
                'id' => 394,
                'order' => '5',
                'article_id' => 14,
                'content' => '聚人民，（任）（地），足此民尔（？）[4]生死之甬（用），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            394 => 
            array (
                'id' => 395,
                'order' => '6',
                'article_id' => 14,
                'content' => '君子女（如）谷（欲）求人（道）[6]……',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            395 => 
            array (
                'id' => 396,
                'order' => '7',
                'article_id' => 14,
                'content' => '……（由）其（道），唯（雖）堯求之弗得也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            396 => 
            array (
                'id' => 397,
                'order' => '8',
                'article_id' => 14,
                'content' => '……六立（位）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            397 => 
            array (
                'id' => 398,
                'order' => '9',
                'article_id' => 14,
                'content' => '又（有）（使）人者，又（有）事人□；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            398 => 
            array (
                'id' => 399,
                'order' => '10',
                'article_id' => 14,
                'content' => '既又（有）[9]夫六立（位）也，以（任）此□□【也】，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            399 => 
            array (
                'id' => 400,
                'order' => '11',
                'article_id' => 14,
                'content' => '……賞慶安（焉），智（知）其以又（有）所（歸）也，材[11]',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            400 => 
            array (
                'id' => 401,
                'order' => '12',
                'article_id' => 14,
                'content' => '唯（雖）才（在）山岳（？）之（中），句（苟）臤（賢）[12]……',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            401 => 
            array (
                'id' => 402,
                'order' => '13',
                'article_id' => 14,
                'content' => '……□父兄（任）者，子弟大材埶（藝）者[13]大官，少（小）材埶（藝）者少（小）官，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            402 => 
            array (
                'id' => 403,
                'order' => '14',
                'article_id' => 14,
                'content' => '……□父兄（任）者，子弟大材埶（藝）者[13]大官，少（小）材埶（藝）者少（小）官，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            403 => 
            array (
                'id' => 404,
                'order' => '15',
                'article_id' => 14,
                'content' => '胃（謂）[14]之君，以宜（義）（使）人多。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            404 => 
            array (
                'id' => 405,
                'order' => '16',
                'article_id' => 14,
                'content' => '非我血（氣）之新（親），畜我女（如）其[15]子弟，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            405 => 
            array (
                'id' => 406,
                'order' => '17',
                'article_id' => 14,
                'content' => '危其死弗敢（愛）也，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:32',
                'updated_at' => '2016-12-08 10:12:32',
            ),
            406 => 
            array (
                'id' => 407,
                'order' => '18',
                'article_id' => 14,
                'content' => '智（知）可[17]為者，智（知）不可為者，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            407 => 
            array (
                'id' => 408,
                'order' => '19',
                'article_id' => 14,
                'content' => '智也者，夫惪（德）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            408 => 
            array (
                'id' => 409,
                'order' => '20',
                'article_id' => 14,
                'content' => '是古（故）夫死又（有）宔（主），終[19]身不（變），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            409 => 
            array (
                'id' => 410,
                'order' => '21',
                'article_id' => 14,
                'content' => '既生畜之，[20]或從而（教）（誨）之，胃（謂）之聖。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            410 => 
            array (
                'id' => 411,
                'order' => '22',
                'article_id' => 14,
                'content' => '子也者，會長材[21]以事上，胃（謂）之宜（義），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            411 => 
            array (
                'id' => 412,
                'order' => '23',
                'article_id' => 14,
                'content' => '古（故）人則為[22]□□□□（仁）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            412 => 
            array (
                'id' => 413,
                'order' => '24',
                'article_id' => 14,
                'content' => '古（故）夫夫，婦婦，父父，子子，君君，臣臣，六者客（各）[23]行其戠（職）而亡（由）迮（作）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            413 => 
            array (
                'id' => 414,
                'order' => '25',
                'article_id' => 14,
                'content' => '雚（觀）者（諸）[24]豊（禮）、樂則亦才（在）壴（矣），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            414 => 
            array (
                'id' => 415,
                'order' => '26',
                'article_id' => 14,
                'content' => '新此多也，此多，[25]此多也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            415 => 
            array (
                'id' => 416,
                'order' => '27',
                'article_id' => 14,
                'content' => '內立父、子、[26]夫也，外立君、臣、婦也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            416 => 
            array (
                'id' => 417,
                'order' => '28',
                'article_id' => 14,
                'content' => '（疏）衰[27]齊戊實，為弟也，為（妻）亦肰（然）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            417 => 
            array (
                'id' => 418,
                'order' => '29',
                'article_id' => 14,
                'content' => '袒字為宗族也，為弸（朋）（友）[28]亦肰（然）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            418 => 
            array (
                'id' => 419,
                'order' => '30',
                'article_id' => 14,
                'content' => '為[29]宗族（朋）（友），不為（朋）（友）宗族。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            419 => 
            array (
                'id' => 420,
                'order' => '31',
                'article_id' => 14,
                'content' => '門內[30]之紉（弇）宜（義），門外之宜（義）斬紉。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            420 => 
            array (
                'id' => 421,
                'order' => '32',
                'article_id' => 14,
                'content' => '（仁）頪（類）而速，宜（義）頪（類）[31]而（絕），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:33',
                'updated_at' => '2016-12-08 10:12:33',
            ),
            421 => 
            array (
                'id' => 422,
                'order' => '33',
                'article_id' => 14,
                'content' => '之為言也，猷（猶）也，少而[32]尞（？）多也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            422 => 
            array (
                'id' => 423,
                'order' => '34',
                'article_id' => 14,
                'content' => '男女[33]卡生言，父子新（親）生言，君臣宜（義）生言。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            423 => 
            array (
                'id' => 424,
                'order' => '35',
                'article_id' => 14,
                'content' => '父聖，子（仁），夫智，婦信，君宜（義），[34]臣宜〈忠〉。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            424 => 
            array (
                'id' => 425,
                'order' => '36',
                'article_id' => 14,
                'content' => '此六者客（各）[35]行其戠（職）而蔑（由）亡〈乍〉也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            425 => 
            array (
                'id' => 426,
                'order' => '37',
                'article_id' => 14,
                'content' => '君子言信言尔，言煬言尔，外[36]內皆得也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            426 => 
            array (
                'id' => 427,
                'order' => '38',
                'article_id' => 14,
                'content' => '其返（反），夫不夫，婦不婦，父不父，子不子，君不君，[37]臣不臣，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            427 => 
            array (
                'id' => 428,
                'order' => '39',
                'article_id' => 14,
                'content' => '君子不帝（啻）明（乎）民（微）而已，或以智（知）[38]其弌（一）壴（矣）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            428 => 
            array (
                'id' => 429,
                'order' => '40',
                'article_id' => 14,
                'content' => '是古（故）先王之[39]（教）民也，司（始）於孝弟。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            429 => 
            array (
                'id' => 430,
                'order' => '41',
                'article_id' => 14,
                'content' => '是古（故）先[40]王之（教）民也，不（使）此民也（憂）其身，（失）其。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            430 => 
            array (
                'id' => 431,
                'order' => '42',
                'article_id' => 14,
                'content' => '下攸（修）惎（其）[41]（本），可以。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            431 => 
            array (
                'id' => 432,
                'order' => '43',
                'article_id' => 14,
                'content' => '君子明（乎）此[42]六者，肰（然）句（後）可以。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            432 => 
            array (
                'id' => 433,
                'order' => '44',
                'article_id' => 14,
                'content' => '（道）不可也，能獸（守）弌（一）曲安（焉），可以[43]其亞（惡），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:34',
            ),
            433 => 
            array (
                'id' => 434,
                'order' => '45',
                'article_id' => 14,
                'content' => '凡君子所以立身大灋（法）參（三），其睪（擇）之也[44]六，其十又二。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:34',
                'updated_at' => '2016-12-08 10:12:35',
            ),
            434 => 
            array (
                'id' => 435,
                'order' => '46',
                'article_id' => 14,
                'content' => '參（三）者皆迵（同），肰（然）句（後）是也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:35',
                'updated_at' => '2016-12-08 10:12:35',
            ),
            435 => 
            array (
                'id' => 436,
                'order' => '47',
                'article_id' => 14,
                'content' => '……人民少者，以攸（修）其身。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:35',
                'updated_at' => '2016-12-08 10:12:35',
            ),
            436 => 
            array (
                'id' => 437,
                'order' => '48',
                'article_id' => 14,
                'content' => '為（道）者必（由）[47]此。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:35',
                'updated_at' => '2016-12-08 10:12:35',
            ),
            437 => 
