            239 => 
            array (
                'id' => 740,
                'order' => '1',
                'article_id' => 20,
                'content' => '行此者丌（其）又（有）不王（乎）▃？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:59',
                'updated_at' => '2016-12-08 10:12:59',
            ),
            240 => 
            array (
                'id' => 741,
                'order' => '2',
                'article_id' => 20,
                'content' => '寺也，文王受命矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:59',
                'updated_at' => '2016-12-08 10:12:59',
            ),
            241 => 
            array (
                'id' => 742,
                'order' => '3',
                'article_id' => 20,
                'content' => '也',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:59',
                'updated_at' => '2016-12-08 10:12:59',
            ),
            242 => 
            array (
                'id' => 743,
                'order' => '4',
                'article_id' => 20,
                'content' => '曰：詩丌（其）猷坪（平）門，與（賤）民而之，丌（其）甬（用）心也（將）可（何）女（如）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:59',
                'updated_at' => '2016-12-08 10:12:59',
            ),
            243 => 
            array (
                'id' => 744,
                'order' => '5',
                'article_id' => 20,
                'content' => '氏（是）也，又城（成）工（功）者可（何）女（如），曰訟氏（是）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:59',
                'updated_at' => '2016-12-08 10:12:59',
            ),
            244 => 
            array (
                'id' => 745,
                'order' => '6',
                'article_id' => 20,
                'content' => '多士，秉（文）之惪（德），（吾）敬之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:59',
                'updated_at' => '2016-12-08 10:12:59',
            ),
            245 => 
            array (
                'id' => 746,
                'order' => '7',
                'article_id' => 20,
                'content' => '褱（懷）尔（明）惪（德）害（曷），城（誠）胃（謂）之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:59',
                'updated_at' => '2016-12-08 10:12:59',
            ),
            246 => 
            array (
                'id' => 747,
                'order' => '8',
                'article_id' => 20,
                'content' => '十月善諀（諞）言。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:12:59',
                'updated_at' => '2016-12-08 10:12:59',
            ),
            247 => 
            array (
                'id' => 748,
                'order' => '9',
                'article_id' => 20,
                'content' => '咎於其也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:00',
                'updated_at' => '2016-12-08 10:13:00',
            ),
            248 => 
            array (
                'id' => 749,
                'order' => '10',
                'article_id' => 20,
                'content' => '疋之攺（怡），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:00',
                'updated_at' => '2016-12-08 10:13:00',
            ),
            249 => 
            array (
                'id' => 750,
                'order' => '11',
                'article_id' => 20,
                'content' => '青（情）（愛）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:00',
                'updated_at' => '2016-12-08 10:13:00',
            ),
            250 => 
            array (
                'id' => 751,
                'order' => '12',
                'article_id' => 20,
                'content' => '好，反內（納）於豊（禮），不亦能攺（怡）虖（乎）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:00',
                'updated_at' => '2016-12-08 10:13:00',
            ),
            251 => 
            array (
                'id' => 752,
                'order' => '13',
                'article_id' => 20,
                'content' => '可（得），不不可能，不亦（智）亙（恆）（乎）？',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:00',
                'updated_at' => '2016-12-08 10:13:00',
            ),
            252 => 
            array (
                'id' => 753,
                'order' => '14',
                'article_id' => 20,
                'content' => '兩矣，丌（其）四章則俞（愉）矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:00',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            253 => 
            array (
                'id' => 754,
                'order' => '15',
                'article_id' => 20,
                'content' => '及丌（其）人，敬（愛）丌（其）（樹），丌（其）保（褒）厚矣。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            254 => 
            array (
                'id' => 755,
                'order' => '16',
                'article_id' => 20,
                'content' => '卲公也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            255 => 
            array (
                'id' => 756,
                'order' => '17',
                'article_id' => 20,
                'content' => '東方未明又（有）利（詞）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            256 => 
            array (
                'id' => 757,
                'order' => '18',
                'article_id' => 20,
                'content' => '因木之保（報），（以）俞（喻）丌（其）（捐）者也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            257 => 
            array (
                'id' => 758,
                'order' => '19',
                'article_id' => 20,
                'content' => '志，既曰天也，猷又（有）（捐）言。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            258 => 
            array (
                'id' => 759,
                'order' => '20',
                'article_id' => 20,
                'content' => '（幣）帛之不可迲（去）也，民眚（性）古（固）然，丌（其）（離）志必又（有）（以）俞（逾）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            259 => 
            array (
                'id' => 760,
                'order' => '21',
                'article_id' => 20,
                'content' => '貴也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            260 => 
            array (
                'id' => 761,
                'order' => '22',
                'article_id' => 20,
                'content' => '之',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            261 => 
            array (
                'id' => 762,
                'order' => '23',
                'article_id' => 20,
                'content' => '（以）樂（詞）而會，（以）道交見善而（傚），冬（終）虖（乎）不猒（厭）人。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            262 => 
            array (
                'id' => 763,
                'order' => '24',
                'article_id' => 20,
                'content' => '（以）□之古（故）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            263 => 
            array (
                'id' => 764,
                'order' => '25',
                'article_id' => 20,
                'content' => '腸（腸腸）少人。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            264 => 
            array (
                'id' => 765,
                'order' => '26',
                'article_id' => 20,
                'content' => '忠。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:01',
                'updated_at' => '2016-12-08 10:13:01',
            ),
            265 => 
            array (
                'id' => 766,
                'order' => '27',
                'article_id' => 20,
                'content' => '女（如）此。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            266 => 
            array (
                'id' => 767,
                'order' => '28',
                'article_id' => 20,
                'content' => '□亞而不。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            267 => 
            array (
                'id' => 768,
                'order' => '29',
                'article_id' => 20,
                'content' => '而不（智）人。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            268 => 
            array (
                'id' => 769,
                'order' => '1',
                'article_id' => 21,
                'content' => '子曰：（好）（美）女（如）（好）衣，亞ˍ（惡惡）女（如）亞（惡）（巷）白（伯）。則民（咸）而型（刑）不。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            269 => 
            array (
                'id' => 770,
                'order' => '2',
                'article_id' => 21,
                'content' => '子曰：又（有）國者章（好）章惡，（以）眂（示）民[1]厚，則民情不弋。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            270 => 
            array (
                'id' => 771,
                'order' => '3',
                'article_id' => 21,
                'content' => '（詩）員（云）：[2]「（淑）人ˍ（君子），丌（其）義（儀）不弋。」',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            271 => 
            array (
                'id' => 772,
                'order' => '4',
                'article_id' => 21,
                'content' => '子曰：上人（疑）則百眚（姓）惑，下難（知）則君長□□□□□□□□□□□[3]谷。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            272 => 
            array (
                'id' => 773,
                'order' => '5',
                'article_id' => 21,
                'content' => '《大顕（雅）》員（云）：「上帝板（板板）□□□□□□□□□□□□[4]隹（惟）王之功。」',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            273 => 
            array (
                'id' => 774,
                'order' => '6',
                'article_id' => 21,
                'content' => '（詩）員（云）：「隹（惟）秉或（國）□□□□正，卒（勞）百眚（姓）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            274 => 
            array (
                'id' => 775,
                'order' => '7',
                'article_id' => 21,
                'content' => '古（故）長民者章志，[6]（以）卲（昭）百眚（姓），則民至（致）行（己）（以）兌（悅）上。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            275 => 
            array (
                'id' => 776,
                'order' => '8',
                'article_id' => 21,
                'content' => '子曰：（禹）立品（三）年，百眚（姓）（以）（仁）。□□□□□□□□□□[7]下土之式。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            276 => 
            array (
                'id' => 777,
                'order' => '9',
                'article_id' => 21,
                'content' => '上（好）□□□□□□□□□□□[8]上之（好）亞（惡），不可不（誓）也，民之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:02',
            ),
            277 => 
            array (
                'id' => 778,
                'order' => '10',
                'article_id' => 21,
                'content' => '子曰：長民者衣備（服）不改，容又（有）（常），則□□□□□□□□□□□□□□□[9]所信。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:02',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            278 => 
            array (
                'id' => 779,
                'order' => '11',
                'article_id' => 21,
                'content' => '《君（陳）》員（云）：未見[10]（聖），女（如）丌（其其）弗克見，我既見，我弗貴（聖）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            279 => 
            array (
                'id' => 780,
                'order' => '12',
                'article_id' => 21,
                'content' => '不可不敬也，民之也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            280 => 
            array (
                'id' => 781,
                'order' => '13',
                'article_id' => 21,
                'content' => '子曰：[12]長民者（教）之（以）惪（德），齊之（以）豊（禮），則民又（有）心。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            281 => 
            array (
                'id' => 782,
                'order' => '14',
                'article_id' => 21,
                'content' => '（詩）員（云）：[13]「（吾）夫（大夫）龏（恭）虘（且）（儉），人不。」',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            282 => 
            array (
                'id' => 783,
                'order' => '15',
                'article_id' => 21,
                'content' => '子曰：正（政）之不行，（教）之不（成）也，□□□□□□□□□□□[14]也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            283 => 
            array (
                'id' => 784,
                'order' => '16',
                'article_id' => 21,
                'content' => '子曰：王言女（如）絲，丌（其）出女（如）緍，王言女（如）索，丌（其）□□□□□□□□□□□□□□[15]敬尔威義。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            284 => 
            array (
                'id' => 785,
                'order' => '17',
                'article_id' => 21,
                'content' => '古（故）言則慮丌（其）所冬（終），行則旨（稽）丌（其）所蔽（敝），則民（慎）於言而（謹）於行。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            285 => 
            array (
                'id' => 786,
                'order' => '18',
                'article_id' => 21,
                'content' => '古ˍ（君子）（寡）言而行，（以）（成）丌（其）信，則民不[17]能大丌（其）（美）而少（小）丌（其）亞（惡）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            286 => 
            array (
                'id' => 787,
                'order' => '19',
                'article_id' => 21,
                'content' => '集大命于氏（是）身。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            287 => 
            array (
                'id' => 788,
                'order' => '20',
                'article_id' => 21,
                'content' => '□□□人君子，丌（其）義（儀）一也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            288 => 
            array (
                'id' => 789,
                'order' => '21',
                'article_id' => 21,
                'content' => '子曰：句（苟）又（有）車，見丌（其），句（苟）又（有）衣，□□□□□□□□□□□□□[20]見丌（其）成。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            289 => 
            array (
                'id' => 790,
                'order' => '22',
                'article_id' => 21,
                'content' => '古（故）ˍ（君子）之（友）也又（有），丌（其）惡也又（有）方，此（以）迩（邇）者不惑，而遠者不（疑）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:03',
            ),
            290 => 
            array (
                'id' => 791,
                'order' => '23',
                'article_id' => 21,
                'content' => '子曰：（輕）（絕）貧賤，而（厚？）（絕）（富）貴，則（好）（仁）不[22]臤（堅），而惡ˍ（惡惡）不也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:03',
                'updated_at' => '2016-12-08 10:13:04',
            ),
            291 => 
            array (
                'id' => 792,
                'order' => '24',
                'article_id' => 21,
                'content' => '員（云）：「我龜既猒（厭），不我告猷ˍ。」',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:04',
                'updated_at' => '2016-12-08 10:13:04',
            ),
            292 => 
            array (
                'id' => 793,
                'order' => '1',
                'article_id' => 22,
                'content' => '凡人唯（雖）又（有）生（性），心亡正志。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:04',
                'updated_at' => '2016-12-08 10:13:04',
            ),
            293 => 
            array (
                'id' => 794,
                'order' => '2',
                'article_id' => 22,
                'content' => '〔眚〕（性）自命出，命自天降。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:04',
                'updated_at' => '2016-12-08 10:13:04',
            ),
            294 => 
            array (
                'id' => 795,
                'order' => '3',
                'article_id' => 22,
                'content' => '〔好〕[2]〔亞〕（惡），〔眚〕（性）〔也〕。〔所〕好、亞（惡），勿也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:04',
                'updated_at' => '2016-12-08 10:13:04',
            ),
            295 => 
            array (
                'id' => 796,
                'order' => '4',
                'article_id' => 22,
                'content' => '〔之〕內，丌（其）眚（性）一也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:04',
                'updated_at' => '2016-12-08 10:13:04',
            ),
            296 => 
            array (
                'id' => 797,
                'order' => '5',
                'article_id' => 22,
                'content' => '凡眚（性），或（動）之，或逆之，或（交）之，或（厲）之，或出〔之〕，〔或〕〔羕〕（養）[4]〔之〕，或長之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:04',
                'updated_at' => '2016-12-08 10:13:04',
            ),
            297 => 
            array (
                'id' => 798,
                'order' => '6',
                'article_id' => 22,
                'content' => '羕（養）眚（性）者，習也；',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:04',
                'updated_at' => '2016-12-08 10:13:04',
            ),
            298 => 
            array (
                'id' => 799,
                'order' => '7',
                'article_id' => 22,
                'content' => '勿（物）之（勢）者之胃（謂）（勢），有為也〔者〕之胃（謂）古（故）。',
