            ),
            304 => 
            array (
                'id' => 805,
                'order' => '13',
                'article_id' => 22,
                'content' => '〔所〕〔〕□□□，丌（其）（譴？）（取）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:05',
                'updated_at' => '2016-12-08 10:13:05',
            ),
            305 => 
            array (
                'id' => 806,
                'order' => '14',
                'article_id' => 22,
                'content' => '〔凡〕聖（聲），丌（其）出於情也信，肰（然）句（後）丌（其）內（入）（拔）人之心也敂。',
                'slip_pic' => NULL,
