            308 => 
            array (
                'id' => 809,
                'order' => '17',
                'article_id' => 22,
                'content' => '〔奠〕〔衛〕〔之〕[16]〔樂〕，〔則〕〔非〕〔丌〕（其）聖（聽）而（從）之也。',
