            326 => 
            array (
                'id' => 827,
                'order' => '35',
                'article_id' => 22,
                'content' => '〔所〕[34]〔為〕〔道〕〔者〕〔四〕，〔唯〕〔人〕道為可道（導）也ˍ。',
