                'updated_at' => '2016-12-08 10:13:07',
            ),
            333 => 
            array (
                'id' => 834,
                'order' => '2',
                'article_id' => 23,
                'content' => '「民[1]〔之〕父母虖（乎），必達於豊（禮）樂之茝（洍），至（致）『五至』行『三亡（無）』，皇（橫）于天下。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:07',
                'updated_at' => '2016-12-08 10:13:07',
            ),
            334 => 
            array (
                'id' => 835,
                'order' => '3',
                'article_id' => 23,
                'content' => '四方又（有）（敗），必先（知）之，亓[2]〔之〕胃（謂）民之父母矣。」',
