            337 => 
            array (
                'id' => 838,
                'order' => '6',
                'article_id' => 23,
                'content' => '「『三亡（無）』虖，亡（無）聖（聲）之樂，亡（無）（體）[5]〔之〕豊（禮），亡（無）備（服）之（喪）。',
