            ),
            339 => 
            array (
                'id' => 840,
                'order' => '8',
                'article_id' => 23,
                'content' => '「亡（無）聖（聲）之樂，亡（體）之豊（禮），亡（無）備（服）之（喪），可（何）志（詩）[7]是（迡）？」',
