            ),
            340 => 
            array (
                'id' => 841,
                'order' => '9',
                'article_id' => 23,
                'content' => '『〔凡〕〔民〕〔有〕〔喪〕，〔匍〕〔匐〕〔救〕〔之〕』，〔無〕〔服〕之（喪）也。」',
