                'updated_at' => '2016-12-08 10:13:13',
            ),
            396 => 
            array (
                'id' => 897,
                'order' => '4',
                'article_id' => 28,
                'content' => '尔司，各共（恭）尔事，（發）命不夜。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:13',
                'updated_at' => '2016-12-08 10:13:13',
            ),
            397 => 
            array (
                'id' => 898,
                'order' => '1',
                'article_id' => 29,
                'content' => '膚（盧）是（氏）、',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:13',
                'updated_at' => '2016-12-08 10:13:13',
            ),
            398 => 
            array (
                'id' => 899,
                'order' => '2',
                'article_id' => 29,
                'content' => '亓惪酋清，而上（愛）[1]下，而一亓志，而寢亓兵，而官亓才（材），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:13',
                'updated_at' => '2016-12-08 10:13:13',
            ),
            399 => 
            array (
                'id' => 900,
                'order' => '3',
                'article_id' => 29,
                'content' => '（侏）需（儒）為矢，長者厇，婁（僂）者坆，（癭）[2]者煮厇，者（漁）澤，弃不（廢）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:13',
                'updated_at' => '2016-12-08 10:13:13',
            ),
            400 => 
            array (
                'id' => 901,
                'order' => '4',
                'article_id' => 29,
                'content' => '於是（乎）不賞不罰，不型（刑）不殺，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:13',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            401 => 
            array (
                'id' => 902,
                'order' => '5',
                'article_id' => 29,
                'content' => '邦無飤（食）人，道（路）無殤[4]死者，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            402 => 
            array (
                'id' => 903,
                'order' => '6',
                'article_id' => 29,
                'content' => '（匡）天下之正（政）十又（有）九年而王天下，丗（三十）又（有）七[5]年而民（泯）冬（終）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            403 => 
            array (
                'id' => 904,
                'order' => '7',
                'article_id' => 29,
                'content' => '於是虖（乎）方[6]百里之（中），（率）天下之人（就），奉而立之，為天子。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            404 => 
            array (
                'id' => 905,
                'order' => '8',
                'article_id' => 29,
                'content' => '於是（乎）（始）語堯天地人民之道。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            405 => 
            array (
                'id' => 906,
                'order' => '9',
                'article_id' => 29,
                'content' => '堯[8]是視（賢）：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            406 => 
            array (
                'id' => 907,
                'order' => '10',
                'article_id' => 29,
                'content' => '「自[9]內（入）焉，余穴（窺）焉。」',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            407 => 
            array (
                'id' => 908,
                'order' => '11',
                'article_id' => 29,
                'content' => '……□□□（賢）者，而（賢）者莫之能受也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            408 => 
            array (
                'id' => 909,
                'order' => '12',
                'article_id' => 29,
                'content' => '……聖（聽）不（聰）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            409 => 
            array (
                'id' => 910,
                'order' => '13',
                'article_id' => 29,
                'content' => '堯為善興（賢），而（卒）立之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            410 => 
            array (
                'id' => 911,
                'order' => '14',
                'article_id' => 29,
                'content' => '堯（聞）之，[13]而（美）亓行。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            411 => 
            array (
                'id' => 912,
                'order' => '15',
                'article_id' => 29,
                'content' => '（舜）[14]受命，乃卉備（服）（箁）（箬）冒（帽），芙蓻□疋□……',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            412 => 
            array (
                'id' => 913,
                'order' => '16',
                'article_id' => 29,
                'content' => '，（辨）為五音，定男女之聖（聲）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            413 => 
            array (
                'id' => 914,
                'order' => '17',
                'article_id' => 29,
                'content' => '昔者天地之差（佐）（舜）而[16]右（佑）善，女（如）是（狀）也。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            414 => 
            array (
                'id' => 915,
                'order' => '18',
                'article_id' => 29,
                'content' => '（禹）乃五壤（讓）天下之（賢）[17]者，不（得）已，（然）句（後）敢受之。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:14',
                'updated_at' => '2016-12-08 10:13:14',
            ),
            415 => 
            array (
                'id' => 916,
                'order' => '19',
                'article_id' => 29,
                'content' => '（禹）乃因山（陵）坪（平）（隰）之可（封）邑[18]者而緐（繁）實之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:15',
