            ),
            416 => 
            array (
                'id' => 917,
                'order' => '20',
                'article_id' => 29,
                'content' => '四（海）之內（及）[19]四（海）之外皆青（請）（貢）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:15',
                'updated_at' => '2016-12-08 10:13:15',
            ),
            417 => 
            array (
                'id' => 918,
                'order' => '21',
                'article_id' => 29,
                'content' => '（中）正之（旗）（熊），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:15',
                'updated_at' => '2016-12-08 10:13:15',
            ),
            418 => 
            array (
                'id' => 919,
                'order' => '22',
                'article_id' => 29,
                'content' => '（宰）不折骨，裚[21]表尃。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:15',
                'updated_at' => '2016-12-08 10:13:15',
            ),
            419 => 
            array (
                'id' => 920,
                'order' => '23',
                'article_id' => 29,
                'content' => '……（舜）聖（聽）正（政）三年，山（陵）不凥（序），水（潦）不湝，乃立（禹）為司工。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:15',
                'updated_at' => '2016-12-08 10:13:15',
            ),
            420 => 
            array (
                'id' => 921,
                'order' => '24',
                'article_id' => 29,
                'content' => '……面（？），不生之毛，湝（流），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:15',
                'updated_at' => '2016-12-08 10:13:15',
            ),
            421 => 
            array (
                'id' => 922,
                'order' => '25',
                'article_id' => 29,
                'content' => '（禹）親執枌＜朷＞（耒）（），波（陂）明者（都）之澤，決九河[24]之（阻），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:15',
                'updated_at' => '2016-12-08 10:13:15',
            ),
            422 => 
            array (
                'id' => 923,
                'order' => '26',
                'article_id' => 29,
                'content' => '（禹）乃迵（通）蔞與，東（注）之[25]（海），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:15',
                'updated_at' => '2016-12-08 10:13:15',
            ),
            423 => 
            array (
                'id' => 924,
                'order' => '27',
                'article_id' => 29,
                'content' => '（禹）乃迵（通）（伊）、洛，并里＜廛＞（瀍）、干（），東[26]（注）之河，',
