                'created_at' => '2016-12-08 10:13:16',
                'updated_at' => '2016-12-08 10:13:16',
            ),
            436 => 
            array (
                'id' => 937,
                'order' => '40',
                'article_id' => 29,
                'content' => '陞（升）自戎（？）述（遂），內（入）自北[39]門，立於中 。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:16',
                'updated_at' => '2016-12-08 10:13:16',
            ),
            437 => 
            array (
                'id' => 938,
                'order' => '41',
                'article_id' => 29,
                'content' => '湯或（又）從而攻之，述（遂）逃，迲（去）之桑（蒼）（梧）之埜（野）。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:16',
                'updated_at' => '2016-12-08 10:13:16',
            ),
            438 => 
            array (
                'id' => 939,
                'order' => '42',
                'article_id' => 29,
                'content' => '……惻（賊）逃（盜）夫。',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:17',
                'updated_at' => '2016-12-08 10:13:17',
            ),
            439 => 
            array (
                'id' => 940,
                'order' => '43',
                'article_id' => 29,
                'content' => '亓政（治）而不賞，官而不（爵），',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:17',
                'updated_at' => '2016-12-08 10:13:17',
            ),
            440 => 
            array (
                'id' => 941,
                'order' => '44',
                'article_id' => 29,
                'content' => '是（乎）（作）為九城（成）之（臺），視（寘）盂（炭）亓下，加（圜）木於亓上，思民道（蹈）之，',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:17',
                'updated_at' => '2016-12-08 10:13:17',
            ),
            441 => 
            array (
                'id' => 942,
                'order' => '45',
                'article_id' => 29,
                'content' => '於是[44]（乎）（作）為金桎三千。',
