            443 => 
            array (
                'id' => 944,
                'order' => '47',
                'article_id' => 29,
                'content' => '受（聞）之，乃出文王於[46]（夏）（臺）之下而（問）焉，曰：',
                'slip_pic' => NULL,
                'created_at' => '2016-12-08 10:13:17',
                'updated_at' => '2016-12-08 10:13:17',
